INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 8, 107501, 1, 37, 0, 91002, "ぺコリーヌ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 8, 107601, 2, 38, 0, 91002, "コッコロ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 8, 107801, 3, 39, 0, 91002, "キャル", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 8, 107701, 4, 40, 0, 91002, "スズメ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 8, 107901, 5, 41, 0, 91002, "タマキ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 8, 107501, 6, 42, 0, 91002, "ぺコリーヌ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 8, 107601, 7, 43, 0, 91002, "コッコロ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 107801, 8, 44, 0, 91002, "キャル", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 8, 107701, 9, 45, 0, 91002, "スズメ", 40001, 150);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 8, 107901, 10, 46, 0, 91002, "タマキ", 40001, 150);
