INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 126001, 5, 325, 0, 24001, "クリア", 40011, 1);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, "お兄。\nきてくれて、うれしい", 2, 126101, 6, 326, 0, 24001, "プレシア", 40011, 1);
